import React from "react";
import TopNavBar from "../TopNavigationBar";
import ProductCard from "../productCards/ProductCard";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";

const Store = props => {
  return (
    <div>
      <TopNavBar />
      <MDBContainer>
        <MDBRow>
          {/* <MDBCol size="12"> */}
          {/* <div className="card-columns"> */}
          <MDBCol xl="3" lg="4" md="6" xs="12">
            <ProductCard />
          </MDBCol>
          <MDBCol xl="3" lg="4" md="6" xs="12">
            <ProductCard />
          </MDBCol>
          <MDBCol xl="3" lg="4" md="6" xs="12">
            <ProductCard />
          </MDBCol>
          {/* </div> */}
        </MDBRow>
        <MDBRow>
          <MDBCol>
            <ProductCard />
          </MDBCol>
          <MDBCol>
            <ProductCard />
          </MDBCol>
          {/* <MDBCol>
            <ProductCard />
          </MDBCol> */}
        </MDBRow>
      </MDBContainer>
      <div>stuff</div>
    </div>
  );
};
export default Store;
